const vars = [
    {text:'happy',id:1},
    {text:'welcome',id:2},
    {text:'playing',id:3},
    {text:'just go',id:4}
]

const Tasks = () => {
  return (
    <>
      {vars.map(item => <h3 key={item.id}>{item.text}</h3>)}
    </>
  )
}

export default Tasks
